public void testBoolAndOperation() throws Exception {
  assertEvaluatesTo("1 && 1", 1);
  assertEvaluatesTo("1 && 0", 0);
  assertEvaluatesTo("0 && 1", 0);
  assertEvaluatesTo("0 && 0", 0);
  assertEvaluatesTo("-1 && -1", 1);
  assertEvaluatesTo("-1 && 0", 0);
  assertEvaluatesTo("0 && -1", 0);
  assertEvaluatesTo("-0 && -0", 0);
}

